id":"cffd0219-baef-48e4-b221-46ca76f05441","type":"GlyphRenderer"},{"attributes":{"fill_color":{"field":"color"},"line_color":{"field":"color"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"6f2f135e-df04-4479-bd22-30a2494f19ce","type":"Circle"},{"attributes":{"formatter":{"id":"2fdf8a2f-355b-421a-9dde-d15e1c378110","type":"BasicTickFormatter"},"plot":{"id":"3d30b583-a52c-42c9-8ce6-83dfbf570248","subtype":"Figure","type":"Plot"},"ticker":{"id":"5761e5ab-c35c-457f-985d-87b1c1eb4d49","type":"BasicTicker"}},"id":"0c71a727-769b-49f7-8c5d-201e070b8541","type":"LinearAxis"},{"attributes":{},"id":"1595efb0-b8c3-4afa-bf66-d669a432150c","type":"PanTool"},{"attributes":{"args":{"source":{"id":"4acd9cf3-4564-4804-8188-64de6346c2c9","type":"ColumnDataSource"}},"code":"\n            // JavaScript code goes here\n            console.log(\"callback-------callback\");\n            var colors = ['#f39c12', \"#1abc9c\", \"#3498db\", \"#2ecc71\", \"#9b59b6\", '#34495e', '#492000', '#960019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.leng
